import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Modal from './Modal'; // Import the Modal component
import Login from './Login'; // Import the Login component
import '../App.css'; // Optional: CSS for styling

const Header = () => {
  const [isModalOpen, setIsModalOpen] = useState(false); // State to control modal visibility

  return (
    <>
      <header className="header">
        <div className="header-title">
          <h1>Pawpaw</h1>
        </div>
        <div className="header-links">
          <button onClick={() => setIsModalOpen(true)}>Login</button> {/* Opens modal */}
          | 
          <Link to="/register">Register</Link> {/* Navigate to Register page */}
        </div>
      </header>

      {/* Modal to show the login form */}
      <Modal isOpen={isModalOpen} onClose={() => setIsModalOpen(false)}>
        <Login onClose={() => setIsModalOpen(false)} /> {/* Pass onClose to handle closing the modal */}
      </Modal>
    </>
  );
};

export default Header;
